import React from 'react';

export class Main extends React.Component {
    render() {
        return (
            <div className = "main">
                <div style = {{backgroundColor: '#c00', flex: 2}}>Profile</div>
                <div style = {{backgroundColor: '#0c0', flex: 3}}>ShotChart</div>
            </div>
        )
    }
}
